When Azure CLI is installed in Jenkins environment, Azure CLI's config directory likely resides in Jenkins workspace directory. To use the Azure CLI, environment variable AZURE_CONFIG_DIR should be specified. Using kubelogin convert-kubeconfig subcommand with --azure-config-dir, the generated kubeconfig will configure the environment variable for get-token subcommand to find the corresponding Azure config directory. For example, stage('Download kubeconfig and convert') { steps { sh 'az aks get-credentials -g ${RESOURCE_GROUP} -n ${CLUSTER_NAME}' sh 'kubelogin convert-kubeconfig -l azurecli --azure-config-dir ${AZURE_CONFIG_DIR:-${WORKSPACE}/.azure}' }
} stage('Run kubectl') { steps { sh 'kubectl get nodes' }
}
